import { useState } from "react";

function Footer() {
  const [inputValue, setInputValue] = useState("Adresse mail ici");

  return (
    <div>
      <textarea
        value={inputValue}
        onChange={(e) => setInputValue(e.target.value)}
      />
    </div>
  );
}

export default Footer;
